function getTrackLayoutImage(gp_location) {
    gp_location = gp_location.toLowerCase();
    let track_container = document.createElement('div');
    track_container.classList.add('track-container');

    let track = document.createElement('img');
    track.src = './images/tracks/' + gp_location.replace(' ', '_') + '.png';
    track.setAttribute('width', '100%');
    track.setAttribute('height', '100%');
    track.alt = 'track layout';

    track_container.appendChild(track);
    return track_container;
}